import React from 'react';
import '../App.css';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import { Link } from 'react-router-dom';
import SearchStudents from './SearchStudents';
import SearchTutors from './SearchTutors';


function Homepage() {
  return (
    <Router>
    <div>This is Homepage.
      <div className="home-link">
        <h1>Welcome to the Study Geek.</h1>
        <Link exact to='/tutors'>I am a student.</Link>
        <Link exact to='/students'>I am a tutor.</Link>
      </div>
      <Route path='/students' component={SearchStudents} /> 
      <Route path='/tutors' component={SearchTutors} /> 
    </div>
    </Router>
  );
}

export default Homepage;
